import Header from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const withLayout = Page => {
  return () => (
    <div>
      <Header style={layoutStyle}/>
      <Page />
    </div>
  );
};

export default withLayout;
